import styled from 'styled-components'

export const SvgPortfolio =styled.svg`
    display:flex;
    justify-content:center;
    align-items:center;
    width: 70%;
    height: 100vh;
    position:absolute;
    opacity: 20%;
    border-radius:10px;

`;

export const GrainyBackgroundContainer =styled.div`
    display:flex;
    justify-content:center;
    align-items:center;
    position:relative;
    height: 100vh;
`;
